import React from 'react';
import Container from './container';
import Text from './text';
import Link from 'next/link';

const AskUploadModal = () => {
  return (
    <Container
      style={{
        position: 'absolute',
        width: '100%',
        height: '100%',
        background: '#4e4e4e6b',
        zIndex:99999,
        top:"0",
      }}
    >
      <Container
        wsize="400px"
        hsize="250px"
        flexDirection=""
        style={{ borderRadius: '5px', background: '#ccc' }}
      >
        <Text>방금 저장하신 그림을 업로드 하러 가시겠습니까?</Text>
        <Link href="">
          <a>예</a>
        </Link>
        <Text>아니오</Text>
      </Container>
    </Container>
  );
};

export default AskUploadModal;
